import React, { Component } from 'react'
import{Table} from "reactstrap"

export default class ProductList extends Component {
  render() {
    
    return(
    <div>
       <h3>{this.props.info.title}-{this.props.currenCategory}</h3>
       <Table>
      <thead>
        <tr>
          <th>#</th>
          <th>First Name</th>
          <th>Last Name</th>
          <th>Username</th>
        </tr>
      </thead>
      <tbody>

      {
           this.props.products.map(product=>(
               <tr key={product.id}>
                 <th scope="row">1</th>
          <td>Mark</td>
          <td>Otto</td>
          <td>@mdo</td>
                 </tr>
           ))}


      </tbody>
    </Table>
      
    </div>
    );
  }
}
